import React from 'react'
import styled from 'styled-components'

const Section = styled.section`
	min-height: 100vh;
	width: 100vw;
	margin: 5rem auto;
	display: flex;
	flex-direction: column;
`
const Footer = () => {
  return <Section>Footer</Section>
}

export default Footer
